/*Table structure for table `ods_open_detail` */

DROP TABLE IF EXISTS `ods_open_detail`;

CREATE TABLE `ods_open_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `hui_che_zf` float NOT NULL COMMENT '回撤振幅',
  `open_price` double NOT NULL COMMENT '开仓价格',
  `is_update` tinyint(1) NOT NULL DEFAULT '0' COMMENT '振幅是否修改过',
  `fk_b_id` int(11) NOT NULL COMMENT '货币ID',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `enable_flag` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否有效',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

