/*Table structure for table `ods_tb_order` */

DROP TABLE IF EXISTS `ods_tb_order`;

CREATE TABLE `ods_tb_order` (
  `id` int(11) NOT NULL COMMENT 'ID',
  `exchange` varchar(32) DEFAULT NULL COMMENT '交易所',
  `account` varchar(32) DEFAULT NULL COMMENT '账户',
  `b_species` varchar(32) DEFAULT NULL COMMENT '币种',
  `order_no` varchar(32) NOT NULL COMMENT '委托单号',
  `rule_type` varchar(32) DEFAULT NULL COMMENT '规则类型',
  `transaction_type` varchar(32) DEFAULT NULL COMMENT '交易类型',
  `b_nums` double DEFAULT NULL COMMENT '币数量',
  `single_price` double DEFAULT NULL COMMENT '单价',
  `profit` double DEFAULT NULL COMMENT '利润',
  `profit_per` double DEFAULT NULL COMMENT '利润百分比',
  `status` varchar(32) DEFAULT NULL COMMENT '状态',
  `remark` varchar(32) DEFAULT NULL COMMENT '备注',
  `last_ut` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最后更新时间',
  `order_dt` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '下单时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

